import styled from 'styled-components';

const ProductsMainPageStyles = styled.section`
  position: relative;

  padding-top: 4rem;
  background: lightgray;
  margin-bottom: 10rem;

  h2 {
    font-size: 4.5rem;
    text-transform: uppercase;
    font-weight: 400;
    color: darkblue;
  }


`;

export { ProductsMainPageStyles };
